import { withRouter } from 'react-router-dom';

import React, { Component } from 'react';

function Home(props) {


    return (
        <div class="App">
            <h3> Express - React with CRUD Operations</h3>
            <p>React front-end calls Express REST API to add,
            list, update, or delete a student</p>
            <br></br>
            <h3> About the Application!</h3>
            <p>This application allows students to signup, login, add/update/drop a course. <br></br>
                They can view the list of courses they are taking, the list of all the students,

                They can also view the list of all the students, </p>
        </div>
    );

}

export default withRouter(Home);
